// src/pages/AuctionDetail.jsx
import React from "react";
import { useParams } from "react-router-dom";
import AuctionLive from "./AuctionLive";
import { Clock, Edit, Play, StopCircle, CheckCircle } from "lucide-react";

// Mock auction data
const mockAuctions = {
  1: { id: 1, status: "LIVE", name: "10Y Bond Auction" },
  2: { id: 2, status: "UPCOMING", name: "5Y Treasury Auction" },
  3: { id: 3, status: "CLOSED", name: "Corporate Bond Auction" },
};

export default function AuctionDetail() {
  const { id } = useParams();
  const auction = mockAuctions[id];

  if (!auction) return <div className="p-8">Auction not found</div>;

  // âœ… LIVE Auction
  if (auction.status === "LIVE") {
    return <AuctionLive />;
  }

  // âœ… UPCOMING Auction
  if (auction.status === "UPCOMING") {
    return (
      <div className="p-8 space-y-6">
        <h1 className="text-2xl font-bold">{auction.name}</h1>
        <p className="text-gray-500">This auction has not started yet.</p>

        {/* Editable Details */}
        <div className="bg-white p-6 rounded-xl shadow space-y-4">
          <div>
            <label className="block text-sm font-medium">Auction Name</label>
            <input
              type="text"
              defaultValue={auction.name}
              className="mt-1 w-full border rounded-lg p-2"
            />
          </div>
          <div>
            <label className="block text-sm font-medium">Start Time</label>
            <input
              type="datetime-local"
              className="mt-1 w-full border rounded-lg p-2"
            />
          </div>
        </div>

        {/* Actions */}
        <div className="flex gap-4">
          <button className="flex items-center gap-2 px-4 py-2 bg-gray-200 rounded-lg">
            <Edit size={16} /> Edit
          </button>
          <button className="flex items-center gap-2 px-4 py-2 bg-teal-600 text-white rounded-lg">
            <Play size={16} /> Start Auction
          </button>
        </div>
      </div>
    );
  }

  // âœ… CLOSED Auction
  if (auction.status === "CLOSED") {
    return (
      <div className="p-8 space-y-6">
        <h1 className="text-2xl font-bold">{auction.name}</h1>
        <p className="text-gray-500">This auction has ended.</p>

        {/* Stats */}
        <div className="grid grid-cols-2 md:grid-cols-4 gap-4 text-center">
          <div className="p-3 bg-white rounded-lg shadow">
            <div className="text-xs text-gray-500">Winning Bid</div>
            <div className="text-lg font-bold">â‚¹102.5</div>
          </div>
          <div className="p-3 bg-white rounded-lg shadow">
            <div className="text-xs text-gray-500">Total Bids</div>
            <div className="text-lg font-bold">245</div>
          </div>
          <div className="p-3 bg-white rounded-lg shadow">
            <div className="text-xs text-gray-500">Participants</div>
            <div className="text-lg font-bold">18</div>
          </div>
          <div className="p-3 bg-white rounded-lg shadow">
            <div className="text-xs text-gray-500">Merkle Root ID</div>
            <div className="text-xs font-mono text-gray-700">0x23a8f...9de</div>
          </div>
        </div>

        {/* Timeline / lifecycle chart placeholder */}
        <div className="bg-white h-64 rounded-xl shadow flex items-center justify-center">
          <span className="text-gray-400">ðŸ“ˆ Auction Lifecycle Chart</span>
        </div>

        {/* Actions */}
        <div className="flex justify-center">
          <button className="flex items-center gap-2 px-4 py-2 border rounded-lg hover:bg-gray-50">
            <CheckCircle size={16} /> Verify Settlement
          </button>
        </div>
      </div>
    );
  }
}
